import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a category to get to a page with price filter
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');
    await page.waitForLoadState('networkidle');

    // Wait for price filter to be available
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Fill price range inputs
    await page.fill('#minPrice', '50');
    await page.fill('#maxPrice', '200');

    // Click apply filter button
    await page.click('.apply-filter');
    await page.waitForLoadState('networkidle');

    // Wait for products to update and take final screenshot
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract some product data to verify filter worked
    const productPrices = await page.$$eval('.product-price', prices => 
      prices.map(p => p.textContent.trim())
    );

    return {
      success: true,
      action: "Applied price range filter of $50-$200 to Electronics category",
      extractedData: {
        productCount: productPrices.length,
        samplePrices: productPrices.slice(0, 3)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
